See also {{msg-mw|wikidata-shortcopyrightwarning}}',
	'wikibase-copyrighttooltip-acknowledge' => 'Label of the link to not show the copyright warning again. A copyright warning is presented to the user whenever the user is about to alter any data unless the warning is not suppressed permanently by clicking this link.',
	'wikibase-entityselector-more' => 'The entity selector is a user interface widget that allows selecting an entity (see [[d:Wikidata:Glossary]]). It consists out of an input field and a list of suggestions that is filled according to the text typed into the input field. Initially, the list of suggestions is filled with a certain number of suggestions. Clicking the link labeled with this message will fill the list of suggestions with additional suggestions. If there are no additional suggestions or no suggestions at all, the link does not show up.
{{Identical|More}}',
	'wikibase-anonymouseditwarning' => "Warning message that is displayed using the MediaWiki notification system each time the user starts to edit something on an entity (see [[d:Wikidata:Glossary]]) page (e.g. by clicking an edit button). Basically, the message shall make the user aware that his/her IP will be recorded when saving as long as not being logged in.

Parameters:
* $1 - the entity's name

See also:
* {{msg-mw|Anoneditwarning}}
* {{msg-mw|Sf autoedit anoneditwarning}}",
	'wikibase-restrictionedit-tooltip-message' => 'When editing a page (a data item) is restricted for the current user, this message is displayed in a tooltip bubble when hovering a tooltip anchor next to an input element, an edit button or any other button (add, save, remove) that might trigger an action altering the data item.',
	'wikibase-blockeduser-tooltip-message' => 'When the current user is blocked from editing a page (a data item), this message is displayed in a tooltip bubble when hovering a tooltip anchor next to an input element, an edit button or any other button (add, save, remove) that might trigger an action altering the data item or creating a new item.

See also {{msg-mw|Blockedtext}}.',
	'wikibase-move-error' => 'The data namespace is blocked against moving pages within it and moving pages into it, because that will make the content inconsistent both within it and on external wikis. The message uses "pages" in this case as name for whats moved, but within the data namespace usually contains "items". See also Wikidatas glossary on [[d:Wikidata:Glossary#page|page]] and [[d:Wikidata:Glossary#item|item]].',
	'wikibase-warning-constraint-violation-length' => 'A warning message that a length constraint is triggered. This will usually come together with a fatal error message.

Parameters:
* $1 - the language code',
	'wikibase-error-constraint-violation-label' => 'Error message that is shown when a user tries to save a multilanguage label that has some constraint violation, typically a string length violation.
* $1 is the count of violating languages
* $2 is the violating languages
* $3 is the violating string on a shortened form, but this is usually not very useful as the message is usually given in an edit window',
	'wikibase-error-constraint-violation-description' => 'Error message that is shown when a user tries to save a multilanguage description that has some constraint violation, typically a string length violation.
* $1 - the count of violating languages
* $2 - the violating languages
* $3 - the violating string on a shortened form, but this is usually not very useful as the message is usually given in an edit window',
	'wikibase-error-constraint-violation-aliases' => 'Error message that is shown when a user tries to save an alias that has some constraint violation, typically a string length violation.
* $1 - the count of violating languages
* $2 - the violating languages
* $3 - the violating string on a shortened form, but this is usually not very useful as the message is usually given in an edit window',
	'wikibase-error-sitelink-already-used' => "Error message shown when an item can't be saved because it contains a site link already used by another item. Parameters:
* $1 is the url to the remote client page;
* $2 is the title on the remote client site;
* $3 is the item (e.g. Q60) on the repo with the conflicting site link.",
	'wikibase-error-label-not-unique-wikibase-property' => 'Error message shown when a user tries to save a property that has a non-unique label.
* $1 is label text
* $2 is the labels language code
* $3 is the id of the property that already has the label',
	'wikibase-error-label-not-unique-wikibase-query' => 'Error message shown when a user tries to save a query that has a non-unique label.
* $1 is label text
* $2 is the labels language code
* $3 is the id of the query that already has the label',
	'wikibase-error-label-not-unique-item' => 'Error message shown when a user tries to save an item that has a non-unique label+description pair. Parameters:
* $1 is label text
* $2 is the labels language code
* $3 is the id of the query that already has the label
* $4 is description text',
	'wikibase-itemlink' => '{{optional}}
used to generate the link text for links to items. $1 is the items label, $2 the id given to "wikibase-itemlink-id-wrapper". This message can be altered to change the position of the single parts within the link. Params:
* $1 is label on a html form
* $2 is id on a html form',
	'wikibase-itemlink-id-wrapper' => '{{optional}}
Used to wrap the items id for a link to an item in parentheses or similar. Params:
* $1 is the prefixed id of the item',
	'wikibase-itemlink-userlang-wrapper' => "{{optional}}
Used to wrap the language and label for an additional entry when the language are different from the user's own. Parameters:
* $1 is the label;s language name
* $2 is the label text",
	'wikibase-itemlink-title' => '{{optional}}
Title attribute set in links to an item. $1 is the items label or (if not available) the prefixed page title of the item. $2 is the items description. Parameters:
* $1 label as a directional string
* $2 description as a directional string',
	'special-itembytitle' => "{{doc-special|ItemByTitle}}
The item is identified through use of the site and title, but the lookup failed and further qualification must be done. See also Wikidata's glossary for [[d:Wikidata:Glossary#languageattribute-label|label]] and [[d:Wikidata:Glossary#Items|items]].",
	'wikibase-itembytitle-lookup-fieldset' => 'This is the title for the fieldset on the special page for further refining the search. This is the search by site and title.',
	'wikibase-itembytitle-lookup-site' => "Label for the textfield holding the site id. See also Wikidata's glossary for [[d:Wikidata:Glossary#sitelinks|site links]].",
	'wikibase-itembytitle-lookup-page' => "Label for the textfield holding the external page title. See also Wikidata's glossary for [[d:Wikidata:Glossary#sitelinks|site links]].
{{Identical|Page}}",
	'wikibase-itembytitle-submit' => 'Text for the submit button in the search form.',
	'wikibase-itembytitle-nothing-found' => 'Informative text that the previous search failed for some reason, and that the search arguments must be refined.',
	'wikibase-itembytitle-invalid-site' => 'Informative text when the provided site id is invalid.',
	'wikibase-itembytitle-description' => 'Further information about the search fields and the valid values.',
	'wikibase-itembytitle-create' => 'Information about how to proceede to create a new item. This message is presented when a user searched (or requested by URL) for an item by site and page title (e.g. item, linked to a particular Wikipedia page in a particular language), but no item was found that linked to that page.  This gives the user the option to create a new item with the page title as the item label.  The user will be sent to the Create Item page and the label would be pre-populated.

